// App.js
import React from 'react';
// import { ToastContainer } from 'react-toastify';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import EventRegistrationApp from './EventRegistrationApp';
import UserRegistrationPage from './UserRegistrationPage';

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/event-registration">Event Registration</Link>
            </li>
            <li>
              <Link to="/user-registration">User Registration</Link>
            </li>
          </ul>
        </nav>

        <Route path="/event-registration" component={EventRegistrationApp} />
        <Route path="/user-registration" component={UserRegistrationPage} />
        <Route exact path="/" component={Home} />
        {/* <ToastContainer /> */}

      </div>
    </Router>
  );
}

function Home() {
  return <h2>Home</h2>;
}

export default App;
